import React from "react";
import Goal from "./Goal";

const Goals = ({ goals }) => {
  return (
    <ul className="goals-list">
      {goals.map((goal, index) => {
        return <Goal goal={goal} key={index} />;
      })}
    </ul>
  );
};

export default Goals;
